Here are a few popular compiler optimization techniques with example codes:

**1. Constant Folding**

Constant folding is a technique where the compiler evaluates constant expressions at compile-time, reducing the number of operations at runtime.

Example:
```c
int x = 2 + 3; // constant folding
```
The compiler will evaluate the expression `2 + 3` at compile-time and replace it with the result `5`, so the generated code will be:
```c
int x = 5;
```
**2. Dead Code Elimination**

Dead code elimination is a technique where the compiler removes code that is unreachable or has no effect on the program's output.

Example:
```c
int x = 5;
if (0) { // dead code
    x = 10;
}
```
The compiler will eliminate the dead code inside the `if` statement, since it is unreachable, and the generated code will be:
```c
int x = 5;
```
**3. Loop Unrolling**

Loop unrolling is a technique where the compiler increases the number of iterations in a loop to reduce the overhead of loop control statements.

Example:
```c
for (int i = 0; i < 10; i++) {
    x += i;
}
```
The compiler may unroll the loop to:
```c
x += 0;
x += 1;
x += 2;
